def countCounterfeit(serialNumber):
    # Write your code here
    total = 0
    for serial in serialNumber:
        testCases = 0
        amount = 0
        if len(serial) < 10 or len(serial) > 12: testCases += 0
        if isUnique(serial[0:3]): 
            testCases += 1
        if int(serial[3:7]) >= 1900 and int(serial[3:7]) <= 2019:
            testCases += 1
        amount = checkDenomination(serial[7:len(serial) - 1])
        if amount != False:
            testCases += 1
        else: 
            amount = 0
        if str.isupper(serial[len(serial) - 1]): testCases += 1
        if testCases == 4:
            total += int(amount)
    return total   
                
def isUnique(s):
    uchars = set()
    for c in s:
        if c in uchars or str.islower(c) or str.isdigit(c):
            return False
        uchars.add(c)
    if len(uchars) == 3:
        return True
    return False

def checkDenomination(s):
    currencyDenom = ["10", "20", "50", "100", "200", "500", "1000"]
    for curr in currencyDenom:
            if s in curr:
                return curr
    return False



